INSERT INTO `mms_log` VALUES (2,NULL,'01056363650','01056363650','3','2020-11-12 17:13:00','이 중, MSGKEY은 자동으로 생성되는 값이니 직접 지정할 필요가 없고, TYPE은 ‘0’으로 조정해야 합니다. 그리고 예약 전송 시 메시지를 보내고자 하는 시간을 REQDATE에 입력해야 합니다(즉시 발송할 경우에는 sysdate, now(), getdate(), current). 아래 예제를 참조하십시오. \r\n메시지 발송상태 및 수신 여부 확인 \r\n발송이 진행됨에 따라 ‘발송상태’ 필드(STATUS)의 값은 아래와 같이 바뀝니다. \r\nSTATUS: ‘0’ (발송대기)  ‘2’ (전송완료)  ‘3’ (결과수신완료) \r\n그리고 ‘결과수신완료’ 처리된 레코드는 MMS 로그 테이블(MMS_LOG_YYYYMM)로 이관됩니다. 만일 시간이 지나도 필드값이 이와 같이 바뀌지 않거나 단말기에 메시지가 수신되지 않는다면 8.3절을 참조하십시오. \r\n주요 DBMS별 발송 테스트 쿼리문 예제 \r\nMysql의 경우 \r\n멀티미디어 컨텐츠 첨부시(MMS) \r\nINSERT ',0,0,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'43200','2020-11-12 17:13:41','2020-11-12 17:13:47','2020-11-12 17:13:43','2020-11-12 17:13:47','1000','0','SKT','SM143962',NULL,NULL,'2','남영우',NULL,NULL,NULL,NULL,NULL,NULL),(3,'','01056363650','01056363650','3','2020-11-12 17:14:00','이 중, MSGKEY은 자동으로 생성되는 값이니 직접 지정할 필요가 없고, TYPE은 ‘0’으로 조정해야 합니다. 그리고 예약 전송 시 메시지를 보내고자 하는 시간을 REQDATE에 입력해야 합니다(즉시 발송할 경우에는 sysdate, now(), getdate(), current). 아래 예제를 참조하십시오. \r\n메시지 발송상태 및 수신 여부 확인 \r\n발송이 진행됨에 따라 ‘발송상태’ 필드(STATUS)의 값은 아래와 같이 바뀝니다. \r\n STATUS: ‘0’ (발송대기)  ‘2’ (전송완료)  ‘3’ (결과수신완료) \r\n그리고 ‘결과수신완료’ 처리된 레코드는 MMS 로그 테이블(MMS_LOG_YYYYMM)로 이관됩니다. 만일 시간이 지나도 필드값이 이와 같이 바뀌지 않거나 단말기에 메시지가 수신되지 않는다면 8.3절을 참조하십시오. \r\n주요 DBMS별 발송 테스트 쿼리문 예제 \r\nMysql의 경우 \r\n 멀티미디어 컨텐츠 첨부시(MMS) \r\nINSERT ',0,0,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'43200','2020-11-12 17:14:57','2020-11-12 17:15:02','2020-11-12 17:14:59','2020-11-12 17:15:02','1000','0','SKT','SM143962',NULL,NULL,'2','남영우',NULL,NULL,NULL,NULL,NULL,NULL),(66,'','01040701725','01096411725','3','2020-11-20 13:19:00','이동인, 안녕! 이달의 웹 매거진이 나왔어. 항상 건강하고 보험 관련 궁금한 건은 연락줘~!\nhttp://test.bocare.co.kr/01096411725',0,0,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'43200','2020-11-20 13:19:06','2020-11-20 13:21:25','2020-11-20 13:21:24','2020-11-20 13:21:25','1000','0','SKT','SM143962',NULL,NULL,'5fb743b976093','이동인',NULL,NULL,NULL,N